const baseUrl = 'http://0.0.0.0:8003';

export const searchData = async (data) => {
    const search_mode = data.search_mode;

    if (search_mode === 'hash') {
        const url = baseUrl + '/search/' + data.input_data;

        const response = await fetch(url, {
            method: 'GET',
            headers: {
                'dynamic_search': ''
            }
        }).then(resp => resp.json());

        console.log('response', response);
    }
};
